import React from 'react';
import './login.css';

class Login extends React.Component {
    imgUrl = 'images/berlin.jpg'
    render() {
        return (
            <div className = "background" floated = "left">
                Login Page
                <Header as="h2" floated = "left">
                    Logun
                </Header>
            </div>
        );
    }
}

export default Login;
